import { Message } from "semantic-ui-react";

class RoleplayWebsite extends Component
{
    render()
    {
        return (
            <div>
                <Message>
                    <Message.Header>Roleplay Website</Message.Header>
                    <Message.Content></Message.Content>
                </Message>
            </div>
        );
    }
}

export default RoleplayWebsite;
